" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Neuromuscular junction disorders in newborns and infants",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?0/10/166/contributors\">",
