var title_f0_10_169="EEG Small sharp spikes or BETS";
var content_f0_10_169=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F62862%7ENEURO%2F78379%7ENEURO%2F70492%7ENEURO%2F73673%7ENEURO%2F51113%7ENEURO%2F81768%7ENEURO%2F65255&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F62862%7ENEURO%2F78379%7ENEURO%2F70492%7ENEURO%2F73673%7ENEURO%2F51113%7ENEURO%2F81768%7ENEURO%2F65255&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 564px\">",
"   <div class=\"ttl\">",
"    Small sharp spikes also known as benign epileptiform transients of sleep (BETS)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 544px; height: 403px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Small sharp spikes (also known as benign epileptiform transients of sleep, or BETS; see boxed area). This is a normal variant.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Drs. Lawrence Hirsch and Hiba Arif.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 564px\">",
"   <div class=\"ttl\">",
"    Wicket spikes",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 544px; height: 283px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    These may appear in clusters or singly in the temporal regions.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Drs. Lawrence Hirsch and Hiba Arif.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 574px\">",
"   <div class=\"ttl\">",
"    Rhythmical midtemporal theta of drowsiness",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 554px; height: 341px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Rhythmical midtemporal theta of drowsiness (RMTD; see arrows); also known as psychomotor variant. This is a normal variant.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Drs. Lawrence Hirsch and Hiba Arif.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 520px\">",
"   <div class=\"ttl\">",
"    Six-Hz spike-and-wave bursts",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 500px; height: 613px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Six-Hz spike-and-wave bursts (\"Phantom spike and wave\"; see arrows): three 1 second bursts from one routine EEG recording. (A) This pattern is accentuated in an average referential montage, sensitivity 5 uV/mm. Note the low amplitude, occipitally predominant \"phantom\" spikes (arrows), and the frequency of approximately 6 per second (B) in a longitudinal bipolar montage (7 uv/mm), this pattern is not as well-appreciated. This is a normal variant.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Drs. Lawrence Hirsch and Hiba Arif.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 512px\">",
"   <div class=\"ttl\">",
"    Subclinical rhythmic EEG discharge of adults (SREDA)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 492px; height: 335px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Subclinical rhythmic EEG discharge of adults (SREDA) in a 52 year old woman with headaches, preceded by a widespread, moderate-to-high amplitude, biphasic waveform. This is a rare but normal variant.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: BF, Westmoreland, Klass, DW. A distinctive rhythmic EEG discharge of adults. Electroencephalogr Clin Neurophysiol 1981; 51:186. Copyright &copy;1981 Elsevier.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 557px\">",
"   <div class=\"ttl\">",
"    Positive occipital sharp transients of sleep (POSTS)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 537px; height: 610px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A) POSTS (Positive occipital sharp transients of sleep), in runs, in a bipolar montage (red arrows). B) A referential recording confirms the positivity in the occipital regions (downgoing waves; green arrows). These are normal discharges.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Drs. Lawrence Hirsch and Hiba Arif.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 482px\">",
"   <div class=\"ttl\">",
"    Breach rhythm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 462px; height: 287px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Breach rhythm noted at the C3 electrode in a 61-year-old man with history of head trauma and a left frontoemporal craniotomy.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Mushtaq, R, Van Cott, AC, Benign EEG variants. Am J Electroneurodiagnostic Technol 2005; 45:88. Copyright &copy;2005 American Society of Electroneurodiagnostic Technologists.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
