var title_f0_10_172="ESC Rx mechanical valve";
var content_f0_10_172=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F54908&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F54908&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    European College of Cardiology guideline summary: Antithrombotic therapy in patients with mechanical heart valves",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        General principles",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thromboembolic risk is related to two factors:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Thrombogenicity of the mechanical valve",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Low - Medtronic Hall, St Jude Medical (without Silzone), CarboMedics AVR",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Medium - Bileaflet valves with insufficient data, Bjork-Shiley",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. High - Lillehei Kaster, Omniscience, Starr Edwards",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Presence or absence of risk factors: atrial fibrillation, left atrial dimension &gt;50 mm, mitral valve gradient, left ventricular ejection fraction &lt;35 percent, spontaneous echo contrast, mitral, tricuspid, or pulmonary valve replacement, or a hypercoagulable state.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Recommendations for anticoagulation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull;&nbsp; Until the INR is stable, intravenous unfractionated heparin (to achieve an activated partial thromboplastin time of 1.5 to 2.0) is probably safer than subcutaneous unfractionated heparin or low molecular weight heparin which, if used, should be accompanied by anti-factor XA monitoring, particularly in patients with renal failure or obesity.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull;&nbsp; For low thrombogenicity valves, warfarin (or other vitamin K antagonist) to achieve a goal INR of 2.5 if no risk factors and 3.0 if risk factors.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull;&nbsp; For medium thrombogenicity valves, warfarin (or other vitamin K antagonist) to achieve a goal INR of 3.0 if no risk factors and 3.5 if risk factors.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull;&nbsp; For high thrombogenicity valves, warfarin (or other vitamin K antagonist) to achieve a goal INR of 3.5 if no risk factors and 4.0 if risk factors.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Addition of antiplatelet therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        &bull;&nbsp; Relative indications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Concurrent arterial disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Coronary artery stenting",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Recurrent embolism, but only after treatment of risk factors and optimization of anticoagulation fail to abolish the problem",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        4. With caged ball valves, with dipyridamole being preferred to aspirin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        &bull;&nbsp; Relative contraindications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. History of gastrointestinal bleeding, particularly associated with ulcer disease or angiodysplasia.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Hyperresponders to aspirin, with excessively prolonged bleeding time.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Poorly controlled hypertension, because of the risk of intracerebral hemorrhage.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        4. Elderly patients, particularly women over age 75.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        5. Patients who take multiple medications, require frequent courses of antibiotics, or have erratic INR control.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Butchart EG, Gohlke-Barwolf C, Antunes MJ, et al. Recommendations for the management of patients after heart valve surgery. Eur Heart J 2005; 26:2463.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
